import axios from 'axios'
import auth0 from '@auth0/auth0-react'
// /api/privateへのリクエスト
export const privateApiRequest = async () => {
  const myHeaders = new Headers();
  const accessToken = auth0.User;
  myHeaders.set("Authorization", "Bearer " + accessToken);
  const response = await fetch("http://localhost:3000/api/private", {
    method: "GET",
    headers: myHeaders
  })
    .then((res) => {
      return res.json();
    })
    .catch((err) => {
      console.log(err);
    });
  alert(JSON.stringify(response));
};
